import React from "react";
import { Container, Col, Row, Badge } from "react-bootstrap";

const Sample = () => {
  return (
    <Container>
      <h1 className="netflix-red">
        Your Netflix Analysis <Badge variant="secondary">Sample</Badge>
      </h1>
    </Container>
  );
};

export default Sample;
